import styled from 'styled-components';
import 'bootstrap/dist/css/bootstrap.min.css';

export const Container = styled.div`
  max-width: 900px;
  margin: 0 auto;
  display: flex;
  th {
    padding: 10px;
    min-width: 100px;
  }
  td {
    padding: 10px;
    min-width: 100px;
  }
  tr {
    padding: 10px;
    min-width: 100px;
  }
`;
export const Input = styled.input`
  width: 150px;
  height: 25px;
`;
